import React from "react";
class Jaki extends React.Component{
    constructor(){
        super();
        this.state={
            fname:"",
            Email:"",
            password:"",
            cpassword:""
        }
    }
    handleFname=(e)=>{
        this.setState({fname:e.target.value})
    }
    handleEmail=(e)=>{
        this.setState({Email:e.target.value})
    }
    handlePassword=(e)=>{
        this.setState({password:e.target.value})
    }
    handleCpassword=(e)=>{
        this.setState({cpassword:e.target.value})
    }

    handleSubmit=()=>{
        if(this.state.fname.length<6){
            alert("full name atlest more than > 6 characters")
        }
        else if(this.state.password !== this.state.cpassword){
            alert("password does not match")
        }
        else{
            alert("successfully submit + this.state.fanme.this.state.email")
        }

    }


    render(){
        return(
            <di>
                <form onSubmit={this. handleSubmit}>
                <label>Fname:</label>
                <input value={this.state.fname} type="text"  required  onChange={this.state.fname}></input>
                <br></br><br></br>
                <label >Email:</label>
                <input value={this.state.Email}  type="email"  required  onChange={this.state.Email}></input>
                <br></br><br></br>
                <label>password:</label>
                <input value={this.state.password}  type="password" required  onChange={this.state.password}></input>
                <br></br><br></br>
                <label>cpassword:</label>
                <input  value={this.state.cpassword} type="Cpassword"required onChange={this.state.cpassword}></input>
                <br></br><br></br>
                </form>
            </di>
          
        )
    }
}
export default Jaki;
